import React from 'react';
//styles
import './wordsBox.scss';

const WordsBox = ({wordsBoxData}) => {
    const { word1, word2, word3, word4, word5 } = wordsBoxData;

    return (
        <div className={'words-container'}>
           <h3 className={'word'}>{word1}</h3>
           <h3 className={'word'}>{word2}</h3>
           <h3 className={'word'}>{word3}</h3>
           <h3 className={'word'}>{word4}</h3>
           <h3 className={'word'}>{word5}</h3>
        </div>
    )
};

export default WordsBox;
